*
* @author Hector Morales <warrior1987@gmail.com>
*/

import React, { Component } from 'react';
import ComboBoxFormDataGrid from '../data_grid/ComboBoxFormDataGrid';
import globalState from '../configuration/GlobalState';
import Form from 'react-bootstrap/Form';

class WindowResetPassword extends Component {
    constructor(props) {        
        super(props);        
    }
    componentWillMount() {
        //....
    }       
  	render() {
        
  	  	return (
                <div id="ContentResetPassword">
                    <div id="Img"><img src="/images/login/logo_logicalsoft_cloud.png" /></div>
                    <div id="contentDat"><div className="text">A continuacion enviaremos el link con las instrucciones para cambiar tu password a tu cuenta de correo</div>
                    <div id="form_content_field_contentDat_username" materialdesign="true" className="form_content_field input-filled" style="width:calc(100% - 20px); min-height:30px; display:block; max-width : 100%;"> 
                        <input type="email" style="width:100%;" className="with-label" obligatorio="true" input-ok="true" name="username" id="form_contentDat_username" value="hector.morales@logicalsoft.co" data-value="hector.morales@logicalsoft.co" data-required="true" data-style="none" data-label="cuenta de correo:" disabled="disabled" /> 
                        <label className="floating-label" for="form_contentDat_username">cuenta de correo:</label>
                    </div>
                    <div id="win-btn-7" className="win-btn" style="width:50px;" data-role="win-btn" data-state="enable"> 
                        <i className="material-icons" style="color:#FFF; font-size:24px; width:100%;top:10px">undefined</i> <button className="save" os="windows">Continuar</button> 
                    </div>
                    <div data-role="div-empty">
                    </div></div>
                </div>  				
			  );
  	}
}

export default WindowResetPassword
